import { Bread } from './Bread';
import { MainNav } from './MainNav';
import { MainSection1 } from './Mainsection1';
import { MainSection2 } from './Mainsection2';
import { MainSection3 } from './Mainsection3';
import { MainSection4 } from './Mainsection4';
import { MainSection5 } from './Mainsection5';
import styles1 from './style/Mainsection1.module.css';  // 전체 CSS 파일 불러오기
import styles2 from './style/Mainsection2.module.css'; 
import styles3 from './style/Mainsection3.module.css'; 
import styles4 from './style/Mainsection4.module.css'; 
import styles5 from './style/Mainsection5.module.css'; 
export function MainContent({mainsection}){
  const getClassName = () => {
    switch (mainsection) {
      case 1:
        return styles1.mainSection1;
      case 2:
        return styles2.mainSection1;
      case 3:
        return styles3.mainSection1;
      case 4:
        return styles4.mainSection1;
      case 5:
        return styles5.mainSection1;
      default:
        return '';
    }
  };

   const mainsectionpage=()=>{
    switch(mainsection){
      case 1: 
        return <MainSection1/>
      case 2:
        return <MainSection2/>
      case 3:
        return <MainSection3/>
      case 4:
        return <MainSection4/>
      case 5:
        return <MainSection5/>

        default:
          break;
    }
   }

  return(
    <div className={`main-content ${getClassName()}`}>
      <MainNav/>
      <Bread/>
      {mainsectionpage()}
      {/* <MainSection/> */}
  </div>
  );
}
